import React, { Component } from "react";

class Menu extends Component {
  constructor() {
    super();

    this.buildMenu = this.buildMenu.bind(this);
  }

  buildMenu() {
    return (
      <div className={"menu"}>
        <div
          className={this.props.isDevDesign ? "inactive" : "active"}
          onClick={this.props.isDevDesign ? null : null}
          /*onClick={this.props.isUXUI ? this.props.menuPressed : null}*/
        >
          Web Dev &amp; Design
        </div>
        <div
          className={(this.props.isDevDesign || this.props.isArt) ? "active" : "inactive"}
          /*onClick={this.props.isUXUI ? null : this.props.menuPressed}*/
        >
          UX &amp; UI
        </div>
        <div
          className={"active"}
        >
          Art
        </div>

      </div>
    );
  }

  render() {
    return <div>{this.buildMenu()}</div>;
  }
}

export default Menu;
